import Logo from './images/netflix.png'
import './App.css';

function App() {
  return (
    <div className="Navbar">
        <img src={Logo} alt='' className="Logo" />
        <div class="flex space-x-4 ...">
          <div>01</div>
          <div>02</div>
          <div>03</div>
        </div>
    </div>
  );
}

export default App;
